description:
Recently sold: $455,000. This Highland Park home offers quality updates and old world charm. Enter through the bright sunroom to a large living room with an attractive brick fireplace flanked by built-in bookcases. The focal point of the dining room is the built in buffet. The eat-in kitchen has a breakfast nook and glows with the original wood cabinets. Honey colored woodwork continues through out the home. There are three bedrooms with hardwood floors, a shaker back porch, and a full ceramic and glass tiled bathroom on the second level. The lower level is a real bonus space, the family room has a second fireplace and three quarter bath. An office with french doors, laundry room, and lots of storage space complete this level. 

Sunroom 11 x 8;
Living Room 18 x 12;
Dining Room 13 x 12;
Kitchen 17 x 9;
Bedroom 12 x 12;
Bedroom 12 x 11;
Bedroom 11 x 8;
Family Room 14 x 14;
Office 9 x 8

Neighborhood Description

Naturally bordered by the scenic and winding Mississippi River, Highland Park is centrally located in the Twin Cities and yet boasts it?s own small-town feel. The Village, a shopping district with plenty of restaurants, boutiques, and beautiful public gardens, is in the heart of the Highland Park neighborhood. Families thrive on the recreational opportunities with miles of park land, golf, little league, a movie theater and a newly renovated park pavilion. Walking quaint, tree lined streets to kindergarten or graduate school, the public library or church, or to The Village for its annual 3 day festival, Highlandfest, there's something for everyone to enjoy in Highland Park.

